webpackJsonp([0xe1e7830d24c7],{444:function(e,t){e.exports={data:{markdownRemark:{html:'<p>As we reach the end of the year, and work slows down that little bit, we have a brief moment to reflect, reset and refocus. For me, that starts with starting to pick up on some of where I left off. Writing, both words and code.</p>\n<p>At present, I am working on a rudimentary Todo API using Nest.js. You can find it here: <a href="https://github.com/nicholaspretorius/itemly">Itemly</a></p>\n<ul>\n<li>The idea here is try and build an improved habit for writing cleaner, more modular code, better tests and documenting in Swagger and Typedoc. </li>\n<li>What I have written so far has been from following the examples in the <a href="https://docs.nestjs.com/">Nest.js documentation</a> as well as taking some cues from other repos. </li>\n</ul>',frontmatter:{title:"Reset."}}},pathContext:{slug:"/til0046/"}}}});
